import React, {Fragment} from "react";
import { Redirect, withRouter } from 'react-router-dom'
import { connect } from 'react-redux'

class GroupInfo extends React.Component{

    componentDidMount(){
        fetch(`http://localhost:3000/api/v1/groups/${this.props.match.params.id}`)
        .then(resp => resp.json())
        .then(group => console.log(group))
    }

    render(){
        return (
        <div className="team_card">
            <h1 className="team_name">Hi!</h1>

        </div>
        );
    }
}

function msp(state){
    return {
        currentUser: state.userReducer.currentUser,
        myTeam: state.teamReducer.myTeam,
        myGroup: state.teamReducer.myTeam,
        sportId: state.teamReducer.currentSportId
    }
}

export default withRouter(connect(msp)(GroupInfo))
// changeViewStatus on all button presses
